// Libraries
import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
// Components
import HomePage from "./pages/HomePage";
// Data
import data from "./data/store-items.json";

class App extends React.Component {
  state = {
    clothes: data,
  };
  render() {
    return (
      <BrowserRouter>
        {/* THIS IS WHERE THE HEADER WILL BE */}
        <>
          <Route
            exact
            path="/"
            render={(props) => (
              <HomePage {...props} clothes={this.state.clothes} />
            )}
          />
        </>
        {/* THIS IS WHERE THE FOOTER WILL BE */}
      </BrowserRouter>
      // <HomePage clothes={this.state.clothes} />
    );
  }
}

export default App;
